import styled from "styled-components/macro";

const Wrapper = styled.div`
  .explore-container {
      height: 450px;
      background-color: grey;
      padding: 0 24px;
  }

  .explore-title {
    padding-top: 20px;
  }

`;

export default Wrapper;
